import React from "react";
import './style.css';

class Home extends React.Component {
    constructor(props) {
        super(props);
        this.state = {}
    }

    render() {
        return (
            <section id="home">
                <div className="container">
                    <div className="row">
                        <div className="col-md-12 col-sm-12">
                            <h3>Welcome to</h3>
                            <h1>DIGITAL TEAM</h1>
                            <h6>ATTORNEY's AT LAW</h6>
                            <hr/>
                                <a href="#work" className="smoothScroll btn btn-danger">What we do</a>
                                <a href="#contact" className="smoothScroll btn btn-default">Talk to us</a>
                            <div id="cover">
                                <form method="get" action="">
                                    <div className="tb">
                                        <div className="td"><input type="text" placeholder="Search" required/></div>
                                        <div className="td" id="s-cover">
                                            <button type="submit">
                                                <div id="s-circle"></div>
                                                <span></span>
                                            </button>
                                        </div>
                                    </div>
                                </form>
                            </div>

                        </div>
                    </div>
                </div>
            </section>
        )
    }
}

export default Home;
